INSERT INTO `products_description` (`id`, `products_id`, `language_id`, `products_name`, `products_description`, `products_url`, `products_viewed`, `products_left_banner`, `products_left_banner_start_date`, `products_left_banner_expire_date`, `products_right_banner`, `products_right_banner_start_date`, `products_right_banner_expire_date`) VALUES
(3, 2, 1, 'Citron – 3-Compartments Petit Bento Lunchbox 540ml – Mini Coral', '<p>Everyone knows the &ldquo;box&rdquo; family. There&rsquo;s cousin postbox, the mail genius. Uncle Boombox, the retired 80s musician. And, of course, Petit Bento lunchbox, the colorful star of the family, handy, sturdy, flexible in size, and ready to be used for anything you throw at it, from snacks to light meals, at home or at school.</p>\r\n\r\n<p><strong>FEATURES</strong></p>\r\n\r\n<p>+ BPA&amp;Phthalates-free</p>\r\n\r\n<p>+ Leak-proof (except for very runny liquids such as water)</p>\r\n\r\n<p>+ Comes with 3 spacious compartments</p>\r\n\r\n<p>+ Leak-proof</p>\r\n\r\n<p>+ Includes a fork and spoon</p>\r\n\r\n<p>+ See-through lid to know what you&rsquo;re packing<br />\r\n+ Microwave-safe</p>\r\n\r\n<p>+ Dimensions: L18*W11.5*H4.6cm</p>\r\n\r\n<p>+ Capacity: 540ml</p>\r\n\r\n<p><strong>CARE INSTRUCTIONS</strong></p>\r\n\r\n<p>Do not put it in the dishwasher.&nbsp;</p>\r\n\r\n<p>Hand-wash with warm soapy water only. Air-dry it overnight.</p>\r\n\r\n<p>Inspect product before use. Do not use the product if damaged.</p>\r\n\r\n<p>Make sure to press from the middle to the end to lock the Petit Bento.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(13, 7, 1, 'Citron – 10-Piece Googly Cartoon Eyes Food Pick Set', '<p><strong>FEATURES&nbsp;</strong></p>\r\n\r\n<p>+&nbsp;BPA-free&nbsp;</p>\r\n\r\n<p>+&nbsp;High-grade&nbsp;PP&nbsp;material?</p>\r\n\r\n<p>+&nbsp;Non-toxic?</p>\r\n\r\n<p>+&nbsp;Heat&nbsp;resistant&nbsp;up&nbsp;to&nbsp;80&deg;C?</p>\r\n\r\n<p>+&nbsp;10-piece&nbsp;cartoon-eye&nbsp;pick&nbsp;set&nbsp;</p>\r\n\r\n<p>+&nbsp;Ideal&nbsp;for&nbsp;fruits&nbsp;and&nbsp;vegetables&nbsp;</p>\r\n\r\n<p>+&nbsp;Eco-friendly&nbsp;as&nbsp;it&nbsp;is&nbsp;reusable?</p>\r\n\r\n<p><strong>CARE&nbsp;INSTRUCTIONS&nbsp;</strong></p>\r\n\r\n<p>To&nbsp;be&nbsp;hand-washed&nbsp;with&nbsp;warm&nbsp;soapy&nbsp;water.&nbsp;</p>\r\n\r\n<p>Leave&nbsp;it&nbsp;air-dry&nbsp;overnight.&nbsp;&nbsp;</p>\r\n\r\n<p>To&nbsp;be&nbsp;hand-washed&nbsp;with&nbsp;warm&nbsp;soapy&nbsp;water.&nbsp;</p>\r\n\r\n<p>Leave&nbsp;it&nbsp;air-dry&nbsp;overnight.&nbsp;&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(19, 13, 1, 'Tommee Tippee Binaural Straw Cup 350ml', '<p>Weighted Silicone Straw for 360&ordm; drinking</p>\r\n\r\n<p>&bull; Soft Straw make it easy to drink from and gentle on baby&rsquo;s sensitive gums</p>\r\n\r\n<p>&bull; No Spurt with water lower than 40&ordm;</p>\r\n\r\n<p>&bull; Keep drink cool or warm for more than 8 hours</p>\r\n\r\n<p>&bull; No Leak with lid open and put the cup downside down</p>\r\n\r\n<p>&bull; Removable silicone base to protect the cup from stretch and drop resistant</p>\r\n\r\n<p>&bull; Carrying strap for little hands easy to hold.</p>\r\n\r\n<p>&bull; Easy Clean</p>\r\n\r\n<p>&bull; Free from BPA</p>\r\n\r\n<p>&bull; Capacity: 350ml suitable for 18month+ toddler</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(20, 14, 1, 'Tommee Tippee Superstar Weighted Straw Cup for Toddlers', '<ul>\r\n	<li>100% leak and shake-proof: Our unique INTELLIVALVE anti-leak technology guarantees this trainer straw cup is completely leak-proof, even when the cup is turned upside down or shaken</li>\r\n	<li>Hygienic: The drinking straw is made with BACSHIELD antibacterial technology that reduces bacteria by up to 99.9%* by preventing the growth of unwanted microbes</li>\r\n	<li>Super soft straw: The soft silicone straw makes drinking easy and is gentle on sensitive gums and flips down between sips to keep it clean.</li>\r\n	<li>Accredited by the Oral Health Foundation Double wall insulated: The insulated base minimises condensation and keeps water cool to encourage drinking and keep kids cool while playing</li>\r\n	<li>Easy clean and BPA-free: Our sippy cups are easy to clean, and steriliser and dishwasher safe. All our products are BPA, BPS, PVC, Phthalate and Nitrosamine free</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(21, 15, 1, 'Pigeon – Baby Wash 2 in 1 700ml', '<p>Can be used for both, head and body washing.<br />\r\nGently clean the baby?s hair, scalp, and body.<br />\r\nEnriched with Jojoba and Chamomile to keep baby?s skin moisturized and protect against mild irritations.<br />\r\nDermatologically tested<br />\r\nDoes not cause allergies, suitable for sensitive baby skin.<br />\r\nHalal certified from MUI (Majelis Ulama Indonesia Council)<br />\r\nDoes not irritate the eyes.<br />\r\nSuitable for the pH 5.5 level of baby?s skin.<br />\r\nDoes not contain dyes that can trigger allergies to baby?s sensitive</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(22, 16, 1, 'Pigeon – Baby Shampoo 400ML Jojoba', '<ul>\r\n	<li>cleans baby&rsquo;s hair and makes baby&rsquo;s hair smooth, tangle-free, and healthy</li>\r\n	<li>Enriched with Jojoba that can care for and moisturize baby&rsquo;s hair, as well as Chamomile to help protect against mild irritation.</li>\r\n	<li>Dermatologically tested</li>\r\n	<li>Does not cause allergies, suitable for sensitive baby skin.</li>\r\n	<li>Halal certified from MUI (Majelis Ulama Indonesia Council)</li>\r\n	<li>Does not irritate the eyes.</li>\r\n	<li>Suitable for the pH 5.5 level of baby&rsquo;s skin.</li>\r\n	<li>Does not contain dyes that can trigger allergies to baby&rsquo;s sensitive</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(23, 17, 1, 'Pigeon – Baby Oil 100ML Jojoba', '<ul>\r\n	<li>Enriched with Jojoba &amp; Chamomile extracts. Makes baby&rsquo;s skin smooth and protected from mild irritation</li>\r\n	<li>Can be used to clean the dirt on the navel hole and earlobe, and can be used when massaging the baby.</li>\r\n	<li>Dermatologically tested</li>\r\n	<li>Does not cause allergies, suitable for sensitive baby skin.</li>\r\n	<li>Halal certified from MUI (Majelis Ulama Indonesia Council)</li>\r\n	<li>Does not contain dyes that can trigger allergies to a baby&rsquo;s sensitive Skin.</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(24, 18, 1, 'Pigeon – Baby Lotion 100ML Jojoba', '<ul>\r\n	<li>Gently formulated to keep the baby&rsquo;s skin moist.</li>\r\n	<li>Enriched with Jojoba extract to help keep the baby&rsquo;s skin moist, as well as chamomile extract to help protect the baby&rsquo;s skin from mild irritation</li>\r\n	<li>Keeping baby&rsquo;s skin smooth, soft, fresh, and fragrant. Use every day after showering</li>\r\n	<li>Dermatologically tested</li>\r\n	<li>Does not cause allergies, suitable for sensitive baby skin.</li>\r\n	<li>Halal certified from MUI (Majelis Ulama Indonesia Council)</li>\r\n	<li>Does not contain dyes that can trigger allergies to baby&rsquo;s sensitive skin.</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(25, 18, 2, 'بيجون - لوشن أطفال 100 مل جوجوبا', '<pre>\r\nمُركب بلطف للحفاظ على بشرة الطفل رطبة.\r\nغني بمستخلص الجوجوبا للمساعدة في الحفاظ على رطوبة بشرة الطفل ، بالإضافة إلى مستخلص البابونج للمساعدة في حماية جلد الطفل من التهيج الخفيف\r\nالحفاظ على بشرة الطفل ناعمة ونضرة وعطرة. استخدميه كل يوم بعد الاستحمام\r\nمفحوصه من قبل اطباءالجلديه\r\nلا يسبب الحساسية ، مناسب لبشرة الطفل الحساسة.\r\nحلال معتمد من MUI (مجلس العلماء الإندونيسي)\r\nلا يحتوي على أصباغ يمكن أن تسبب الحساسية لبشرة الطفل الحساسة.</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(26, 17, 2, 'بيجون - زيت أطفال 100 مل جوجوبا', '<pre>\r\nغني بمستخلصات الجوجوبا والبابونج. يجعل بشرة الطفل ناعمة ومحمية من التهيج الخفيف\r\nيمكن استخدامه لتنظيف فتحة السرة وشحمة الأذن ، ويمكن استخدامه عند تدليك الطفل.\r\nمفحوصه من قبل اطباءالجلديه\r\nلا يسبب الحساسية ، مناسب لبشرة الطفل الحساسة.\r\nحلال معتمد من MUI (مجلس العلماء الإندونيسي)\r\nلا يحتوي على أصباغ يمكن أن تسبب الحساسية لبشرة الطفل الحساسة.</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(27, 16, 2, 'بيجون - شامبو للأطفال 400 مل جوجوبا', '<pre>\r\nينظف شعر الطفل ويجعل شعر الطفل ناعمًا وخالٍ من التشابك وصحي\r\nغني بالجوجوبا التي يمكنها العناية بشعر الطفل وترطيبه ، بالإضافة إلى البابونج للمساعدة في الحماية من التهيج الخفيف.\r\nمفحوصه من قبل اطباءالجلديه\r\nلا يسبب الحساسية ، مناسب لبشرة الطفل الحساسة.\r\nحلال معتمد من MUI (مجلس العلماء الإندونيسي)\r\nلا تهيج العينين.\r\nمناسب لدرجة الحموضة 5.5 لبشرة الطفل.\r\nلا يحتوي على أصباغ يمكن أن تسبب الحساسية لحساسية الطفل</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(28, 15, 2, 'بيجون - غسول أطفال 2 في 1700 مل', '<pre>\r\nيمكن استخدامه لغسيل الرأس والجسم.\r\nنظف شعر الطفل وفروة رأسه وجسمه برفق.\r\nغني بالجوجوبا والبابونج للحفاظ على بشرة الطفل رطبة وحمايتها من التهيجات الخفيفة.\r\nمفحوصه من قبل اطباءالجلديه\r\nلا يسبب الحساسية ، مناسب لبشرة الطفل الحساسة.\r\nحلال معتمد من MUI (مجلس العلماء الإندونيسي)\r\nلا تهيج العينين.\r\nمناسب لدرجة الحموضة 5.5 لبشرة الطفل.\r\nلا يحتوي على أصباغ يمكن أن تسبب الحساسية لحساسية الأطفال</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(29, 14, 2, 'كوب بقشة مرجح سوبر ستار للأطفال الصغار من Tommee Tippee', '<pre>\r\n100٪ مقاوم للتسرب والاهتزاز: تضمن تقنية منع التسرب الفريدة INTELLIVALVE الخاصة بنا أن يكون كوب المصاصة هذا مانعًا للتسرب تمامًا ، حتى عندما ينقلب الكوب رأسًا على عقب أو يهتز\r\nصحيًا: ماصة الشرب مصنوعة بتقنية BACSHIELD المضادة للبكتيريا التي تقلل البكتيريا بنسبة تصل إلى 99.9٪ * عن طريق منع نمو الميكروبات غير المرغوب فيها\r\nماصة فائقة النعومة: ماصة السيليكون الناعمة تجعل الشرب أمرًا سهلاً ولطيفًا على اللثة الحساسة وتنقلب بين الرشفات للحفاظ على نظافتها.\r\nمعتمدة من مؤسسة Oral Health Foundation معزولة بجدار مزدوج: تقلل القاعدة المعزولة من التكثيف وتحافظ على مبرد الماء لتشجيع الشرب والحفاظ على برودة الأطفال أثناء اللعب\r\nسهلة التنظيف وخالية من مادة BPA: تتميز أكواب الشرب لدينا بسهولة التنظيف ، كما أنها آمنة للغسل في غسالة الأطباق. جميع منتجاتنا خالية من BPA و BPS و PVC و Phthalate و Nitrosamine</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(30, 13, 2, 'كوب بمصاصة بكلتا الأذنين من Tommee Tippee 350 مللي', '<pre>\r\nمصاصة سيليكون مرجحة للشرب 360 درجة\r\n\r\n&bull; مصاصة ناعمة تسهل الشرب من لثة الطفل الحساسة ولطيفة عليها\r\n\r\n&bull; عدم حدوث طفرة بمياه أقل من 40 درجة مئوية\r\n\r\n&bull; حافظ على المشروب باردًا أو دافئًا لأكثر من 8 ساعات\r\n\r\n&bull; لا يوجد تسرب مع الغطاء مفتوحا وضع الكوب مقلوبًا\r\n\r\n&bull; قاعدة سيليكون قابلة للفك لحماية الكوب من التمدد والسقوط\r\n\r\n&bull; حزام حمل للأيدي الصغيرة سهل الإمساك به.\r\n\r\n&bull; سهل التنظيف\r\n\r\n&bull; خالية من BPA\r\n\r\n&bull; السعة: 350 مل مناسبة لعمر 18 شهرًا + طفل صغير</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(31, 7, 2, 'Citron - مجموعة من 10 قطع Googly Cartoon Eyes Food Pick', '<pre>\r\nالميزات\r\n+ خالية من BPA\r\n+ مادة PP عالية الجودة؟\r\n+ غير سام؟\r\n+ مقاومة للحرارة حتى 80 درجة مئوية؟\r\n+ طقم من 10 قطع من الكارتون\r\n+ مثالي للفواكه والخضروات\r\n+ صديقة للبيئة لأنها قابلة لإعادة الاستخدام؟\r\nتعليمات العناية\r\nيغسل يدوياً بالماء الدافئ والصابون.\r\nاتركه يجف في الهواء طوال الليل.\r\nيغسل يدوياً بالماء الدافئ والصابون.\r\nاتركه يجف في الهواء طوال الليل.</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(32, 2, 2, 'سيترون - 3-حجرات بيتي بينتو لانش بوكس ​​540 مل - ميني كورال', '<pre>\r\nيعرف الجميع عائلة &quot;الصندوق&quot;. هناك صندوق بريد ابن عم ، عبقرية البريد. العم بومبوكس ، موسيقي متقاعد من الثمانينيات. وبالطبع ، صندوق الغداء بيتي بينتو ، النجم الملون للعائلة ، سهل الاستخدام ، قوي ، مرن في الحجم ، وجاهز للاستخدام في أي شيء ترميه عليه ، من الوجبات الخفيفة إلى الوجبات الخفيفة ، في المنزل أو في المدرسة.\r\n\r\nالميزات\r\n\r\n+ BPA وخالي من الفثالات\r\n\r\n+ مانع للتسرب (باستثناء السوائل شديدة السيل مثل الماء)\r\n\r\n+ يأتي مع 3 مقصورات واسعة\r\n\r\n+ مانعة للتسرب\r\n\r\n+ يتضمن شوكة وملعقة\r\n\r\n+ غطاء شفاف لمعرفة ما تقوم بتعبئته\r\n+ آمن للاستخدام في الميكروويف\r\n\r\n+ الأبعاد: L18 * W11.5 * H4.6 سم\r\n\r\n+ السعة: 540 مل\r\n\r\nتعليمات العناية\r\n\r\nلا تضعه في غسالة الأطباق.\r\n\r\nيُغسل يدويًا بالماء الدافئ والصابون فقط. قم بتجفيفه بالهواء طوال الليل.\r\n\r\nافحص المنتج قبل الاستخدام. لا تستخدم المنتج في حالة تلفه.\r\n\r\nتأكد من الضغط من المنتصف إلى النهاية لقفل Petit Bento.</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0);
